    /**
     * 想法：把searchWord拆分成n个字符，每次遍历products中每一个的对应位置
     * 比如说
     * products = ["mobile","mouse","moneypot","monitor","mousepad"]
     * searchWord = "mouse"
     * 排序后，先查找products中第一个字母是m的，然后是第二个字母是o的，以此类推
     * 此时需要注意：
     * 1.searchWord的长度可能会会比products中的元素长
     * 2.需要及时把products对应的标记位标记为假，避免再次访问
     * 3.不能只遍历前三个，全都要遍历，不然标记位不起作用
     *
     * @param products
     * @param searchWord
     * @return
     */
    public static List<List<String>> suggestedProducts(String[] products, String searchWord) {
        List<List<String>> list = new ArrayList<>();
        boolean[] bo = new boolean[products.length];
        for (int i = 0; i < products.length; i++) {
            bo[i] = true;
        }
        Arrays.sort(products);
//        别人的想法（可行的），和我的类似，只不过他是匹配整个词，我是匹配单个字
//        （之前我也尝试过他写的思路，划分子序列的时候未考虑i和product的长度）
//        for (int i = 0; i < searchWord.length(); i++) {
//            List<String> temp = new ArrayList<>();
//            String s = searchWord.substring(0, i+1);
//            int size  = 0;
//            for (String product : products) {
//                if (product.substring(0, Math.min(i+1, product.length())).equals(s)) {
//                    temp.add(product);
//                    size++;
//                }
//                if (size == 3) break;
//            }
//            list.add(temp);
//        }
//        自己的想法，如前面所说
        for (int i = 0; i < searchWord.length(); i++) {
            char s = searchWord.charAt(i);
            List<String> s_list = new ArrayList<>();
            int num = 0;
            for (int j = 0; j < products.length; j++) {
                if (products[j].length() < i+1) {
                    bo[j] = false;
                    continue;
                }
                if (bo[j] && products[j].charAt(Math.min(i, products[j].length()-1)) == s) {
                    if (num < 3) s_list.add(products[j]);
                    num++;
                } else bo[j] = false;
            }
            list.add(s_list);
        }
        return list;
    }

